import React from "react";
import { Layout } from "antd";
import "./SideBar.css"
const SideBar = ({ menu }) => {
  return (
    <Layout.Sider
      className="sidebar"
      breakpoint={"lg"}
      theme="light"
      collapsedWidth={0}
      trigger={null}
      style={{backgroundColor:'#fff'}}
    >
        {menu}
    </Layout.Sider>
  );
};

export default SideBar;
